import React from 'react';
import { withRouter } from 'react-router-dom';
import { withStyles, AppBar, Grid, Snackbar, Container, Link } from '@material-ui/core';
import { withTranslation } from 'react-i18next';
import stylePage from './style';

class Header extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      countdown: {
        days: '',
        hours: '',
        mins: '',
        secs: '',
      },
      openAlert: false,
      openAlertType: '',
      openAlertText: '',
      drawer: false,
      expanded: 'panel1',
      amount: '500',
      currency: 'USDT',
      currency_symbol: 'USDT',
      guarantee_amount: '',
      guarantee_currency: 'BTC',
      contract_type: 1,
      installmentSelected: '',
      listInstallments: [],
      currency_usd: false,
      currency_eur: false,
      currency_gbp: false,
      currency_brl: false,
      loans_fee_guarantee: '-',
      loans_tax_guarantee: '-',
      loans_fee: '-',
      loans_tax: '-',
      simulatorStep1: true,
      readyStep1: false,
      simulatorStep2: false,
      readyStep2: false,
      simulatorStep3: false,
      isTransparent: '',
      readyStep2type: 0,
      customer_id: false,
      customer_fullname: '',
      customer_email: '',
      customer_password: '',
      customer_password2: '',
      cryptocurrencies: false,
      mycryptos: [],
    };
  }

  handleLanguageEn = () => {
    localStorage.removeItem('language');
    localStorage.setItem('language', JSON.stringify({ lang: 'en' }));
    this.props.i18n.changeLanguage('en');
  };

  handleLanguageEs = () => {
    localStorage.removeItem('language');
    localStorage.setItem('language', JSON.stringify({ lang: 'es' }));
    this.props.i18n.changeLanguage('es');
  };

  handleLanguagePt = () => {
    localStorage.removeItem('language');
    localStorage.setItem('language', JSON.stringify({ lang: 'pt' }));
    this.props.i18n.changeLanguage('pt');
  };
  handleLanguageFr = () => {
    localStorage.removeItem('language');
    localStorage.setItem('language', JSON.stringify({ lang: 'fr' }));
    this.props.i18n.changeLanguage('fr');
  };
  handleLanguageIt = () => {
    localStorage.removeItem('language');
    localStorage.setItem('language', JSON.stringify({ lang: 'it' }));
    this.props.i18n.changeLanguage('it');
  };
  handleLanguageDe = () => {
    localStorage.removeItem('language');
    localStorage.setItem('language', JSON.stringify({ lang: 'de' }));
    this.props.i18n.changeLanguage('de');
  };
  handleLanguageEt = () => {
    localStorage.removeItem('language');
    localStorage.setItem('language', JSON.stringify({ lang: 'et' }));
    this.props.i18n.changeLanguage('et');
  };
  handleLanguageRu = () => {
    localStorage.removeItem('language');
    localStorage.setItem('language', JSON.stringify({ lang: 'ru' }));
    this.props.i18n.changeLanguage('ru');
  };
  render() {
    const { classes, t, isTransparent } = this.props;
    let currentLanguage = JSON.parse(localStorage.getItem('language'));

    document.querySelector('body').style.margin = 0;
    const listCountries = [];
    const listCountriesArray = JSON.parse(localStorage.getItem('listCountries')) !== null ? JSON.parse(localStorage.getItem('listCountries')) : [];

    const appBarStyle = isTransparent ? { borderBottom: 'none', background: 'transparent' } : {};

    listCountriesArray.map((country) => {
      if (currentLanguage.lang !== 'en') {
        listCountries.push({ title: country['name_' + currentLanguage.lang], value: country['name_' + currentLanguage.lang] });
        return '';
      } else {
        listCountries.push({ title: country.name, value: country.name });
        return '';
      }
    });
    return (
      <>
        <Snackbar
          open={this.state.openAlert}
          autoHideDuration={6000}
          onClose={() => this.setState({ openAlert: false })}
          anchorOrigin={{ vertical: 'bottom', horizontal: 'right' }}
          style={{ right: '2%' }}
        ></Snackbar>

        <AppBar position='static' className={classes.AppBar} style={appBarStyle}>
          <div className={classes.container}>
            <Container>
              <Grid container className={classes.containerCustom}>
                <Grid item xs={12} md={2} className={classes.AppBarLogo}>
                  <div className={classes.howItWorksBlock01}>
                    <Link href='/'></Link>
                  </div>
                </Grid>
              </Grid>
            </Container>
          </div>
        </AppBar>
      </>
    );
  }
}

export default withRouter(withStyles(stylePage)(withTranslation()(Header)));
